  return (
    <Container>
      <NavBack text={"독후감 쓰기"} link={"-1"} />
      <TextForm/>
      <CommentList />
    </Container>
  );
}

const Container = styled.div`
  background: #f9f9f7;
  height: 100vh;
  width: 100%;
`;
